var domainBaseUrl = "https://api.holidayzone.biz";
    var tempLoc = window.location.href;
    var isProdAuthor = (tempLoc.indexOf("prod-author") > -1 || tempLoc.indexOf("prod-new-author") > -1 );
	var isProdPublisher = (tempLoc.indexOf("prod-publisher") > -1 || tempLoc.indexOf("prod-new-publisher") > -1 );
	var isProdDispatcherHost = (tempLoc.indexOf("www.sterlingholidays.com")> -1) || (tempLoc.indexOf("beta.sterlingholidays.com")> -1);
	var isProdDispatcherElb = (tempLoc.indexOf("prod-dispatcher") > -1 || tempLoc.indexOf("prod-new-dispatcher") > -1);

    if(isProdAuthor || isProdPublisher  || isProdDispatcherHost || isProdDispatcherElb){
    	domainBaseUrl = "https://beta-api.sterlingholidays.com";
    }
var amountSpent = 0;
var memberSpent = 0;
var winScrollEvt = false;
$(document).ready(function()
{
  if($("#amountChart").is(":visible")) {
    var myChart;
    var ms_values = document.getElementById('amountChart').getContext('2d');
    /* ===================================== */
    /*             Chart value               */
    /* ===================================== */    
    var chartData = new Array(0, 100);
    var amountLabels = ["Total amount saved being a Sterling Member","Amount spent "];
    var amountLabelsValues = chartData;
    var amountLabelsColors = ["#762979","#ababab"];
    var amountLabels_data = {
        labels: amountLabels,
        datasets: [
          {          
            label: "Your payment on hotel holidays for 25 years.",
            backgroundColor: amountLabelsColors,
            data: amountLabelsValues,
            borderColor: "#fff",
            borderWidth: 0,
            hoverOffset: 0
          }
        ],
    };
    var amountLabels_options = {
        animation : true,
        animationEasing : "easeOutSine",
        percentageInnerCutout: 60,
        segmentShowStroke : false,
        cutout: 75,
        plugins:{
           legend:{
               display: false
           },
           tooltip: {
              enabled: false
           }
        },
    };

    const membership_plan = [329000, 449000, 599000, 899000];
    const asf = [8312, 10872, 14067, 15987];
    var plancost = 0;
    var asfcost = 0;

    $("#btn_calc").on("click", function()
    {
        var room_rate = $('#amount-spent').val();
        var inflation_rate = $('#inflation-rate').val();
        
        if(inflation_rate == 0)
        {
            alert('Please select inflation rate.');
            return false;
        }

        //--
        var inflation_rof_1 = (1 + ( inflation_rate/100) ) ;

        var power = Math.pow(inflation_rof_1, 25) - 1;
        //var power = power.toFixed(0);

        var inflation_rof_2 = ( (1 + (inflation_rate/100) ) - 1);
        //inflation_rof_2 = inflation_rof_2.toFixed(2);

        var equivalent_cost = room_rate * 1.57;

        if( ( equivalent_cost >= 3000 && equivalent_cost <= 5000 ) )
        {
            plancost = 329000;
            asfcost  = 8312;
        }
        else if( equivalent_cost >= 5001 && equivalent_cost <= 7000 )
        {
            plancost = 449000;
            asfcost  = 10872;
        }
        else if( equivalent_cost >= 7001 && equivalent_cost <= 10000 )
        {
            plancost = 599000;
            asfcost  = 14067;
        }
        else
        {
            plancost = 899000;
            asfcost  = 15987;
        }

        var week_spent = equivalent_cost * 7;

        var a = Math.round( week_spent * ( power / inflation_rof_2 ) );
        var b = (a / 1000) * 1000;
        var c = b + 1000;

        //-- Amount Spent with Inflation Rate
        var twentyfiveyears_a = (a - b > c - a) ? c : b;

        var a = Math.round( ( asfcost * ( power / inflation_rof_2 ) ) + plancost );
        var b = (a / 1000) * 1000;
        var c = b + 1000;

        var twentyfiveyears_b = (a - b > c - a) ? c : b;

        var amount_saved = twentyfiveyears_a - twentyfiveyears_b;

        var total_years = 25;

        var spent_peryear = new Array();
        var spent_arr = new Array();
        var cost_peryear = week_spent;
        var cum_cost = cost_peryear;
        var base_memcost = membership_plan[0];
        var base_asf = 9638;
        var sm_cumcost = base_asf + base_memcost;
        var diff_cost = sm_cumcost - cum_cost;

        for(let i = 1; i <= total_years; i++)
        {
            if(diff_cost > 0)
            {
                spent_arr['cost_per_year'] = cost_peryear,
                spent_arr['cum_cost'] = cum_cost,
                spent_arr['Member ASF'] = base_asf,
                spent_arr['sm_member_cost'] = sm_cumcost,
                spent_arr['diff_cost'] = diff_cost

                spent_peryear.push(spent_arr);

                cost_peryear = Math.round(cost_peryear * inflation_rof_1);
                cum_cost = cost_peryear + cum_cost;
                base_asf = Math.round(base_asf * inflation_rof_1);
                sm_cumcost = sm_cumcost + base_asf;
                diff_cost = sm_cumcost - cum_cost;
            }
            else
            {
                var no_of_years = spent_peryear.length;
                console.log("No. Of Years: " + no_of_years);
                if( no_of_years < 7)
                {
                    no_of_years = no_of_years + 1;
                }
            }
        }
        /*
        'plancost' => $plancost,
        "equivalent_cost" => $equivalent_cost,
        "week_spent" => $week_spent,
        "twentyfive_years_inflation" => $twentyfiveyears_a,
        "twentyfive_years" => $twentyfiveyears_b,
        "amount_saved" => $amount_saved,
        "chart" => $spent_peryear,
        "no_of_years" => $no_of_years,
        */
        var amountspent = twentyfiveyears_a;
        var amountSaved = amount_saved;

        $('#studio-room-cost').val( numberWithCommas(equivalent_cost) );
        $('#amount-spent-week').val( numberWithCommas(week_spent) );
        $('#amount-spent-25year').val( numberWithCommas(twentyfiveyears_a) );
        $('#amount-saved').val( numberWithCommas(amount_saved) );
        $('#entire-amount').val( numberWithCommas(no_of_years) );
        //-- UPDATE CHART
        chartData = new Array(amountSaved, amountspent);
        amountLabels_data = {
            labels: amountLabels,
            datasets: [
                {          
                    label: "Your payment on hotel holidays for 25 years.",
                    backgroundColor: amountLabelsColors,
                    data: chartData,
                    borderColor: "#fff",
                    borderWidth: 0,
                    hoverOffset: 0
                }
            ]
        };
        update_chart(ms_values, amountLabels_data, amountLabels_options);
        //--
        winScrollEvt = false;
        setTimeout(function()
        {
            window.addEventListener('scroll', (event) => {
                if( winScrollEvt == false )
                {
                    $("body").toggleClass("form-open");
                }
                winScrollEvt = true;
                return false;
            });
        }, 500);
        document.getElementById('btn_calc').disabled = true;
	});
    $(".shForm-close").on("click", function()
    {
		$("body").removeClass("form-open");
        $('html, body').animate({
            scrollTop: $("#card-purple").offset().top
        }, 2000);
        resetAllFields();
	});
    show_chart(ms_values, amountLabels_data, amountLabels_options);
    calculateEquiCost(); //-- Default calculation of Equivalent Cost.

    $("#reset-calc").on("click", function()
    {
		resetCalc();
	});
}

});

function calculateEquiCost()
{
    //--
    var room_rate = $('#amount-spent').val();
    var equivalent_cost = room_rate * 1.57;
    $('#studio-room-cost').val( numberWithCommas(equivalent_cost) );
}

function numberWithCommas(x) {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

function updateTextInput(val) {
    document.getElementById('amount-spent').value = val;
}

function show_chart(ms_values, chartData, chartLabels)
{
    myChart = new Chart(ms_values, {
        type: 'doughnut',
        data: chartData,
        options: chartLabels
    });
}

function update_chart(ms_values, chartData, chartLabels)
{
    myChart.destroy();

    myChart = new Chart(ms_values, {
        type: 'doughnut',
        data: chartData,
        options: chartLabels
    });
}

if($("#sbmt_spform").is(":visible")) {
    document.getElementById('sbmt_spform').addEventListener("click", function(evt)
    {
        var trgt = evt.target.id;
        trgt = trgt.split("_");
        trgt = document.getElementById(trgt[1]);
        validateForm(trgt);
    
    })
    document.getElementById('sbmt_sfpopform').addEventListener("click", function(evt)
    {
        var trgt = evt.target.id;
        trgt = trgt.split("_");
        trgt = document.getElementById(trgt[1]);
        validateForm(trgt);
    })
    document.getElementById('res_spform').addEventListener("click", function(evt)
    {
        resetAllFields();
    })
    document.getElementById('res_sfpopform').addEventListener("click", function(evt)
    {
        resetAllFields();
    })

}
// Defining a function to display error message
function printError(elemId, hintMsg)
{
    document.getElementById(elemId).innerHTML = hintMsg;
}

 function validateForm(oFormElement)
{
    var currForm = oFormElement.getAttribute("id");

    // Retrieving the values of form elements 
    var first_name = oFormElement.first_name.value;
    var last_name = oFormElement.last_name.value;
    var city = oFormElement.city.value;
    var mobile = oFormElement.mobile.value;
    var email = oFormElement.email.value;

    // Defining error variables with a default value
    var first_nameErr = last_nameErr = emailErr = mobileErr = cityErr = true;

    // Only Alphabets are allowed
    var regex = /^[a-zA-Z\s]+$/;

    // Regular expression for basic email validation
    var mail_regex = /^\S+@\S+\.\S+$/;

    // Regular expression for mobile validation
    var mobile_regex = /^[1-9]\d{9}$/;

    // Validate First Name value
    if(first_name == "" || first_name.length <= 0)
    {
        printError(""+currForm+"_"+"first_nameErr", "Please enter your first name");
        first_nameErr = false;
    }
    else
    {
        if(regex.test(first_name) === false)
        {
            printError(""+currForm+"_"+"first_nameErr", "Please enter a valid first name");
            first_nameErr = false;
        }
        else
        {
            printError(""+currForm+"_"+"first_nameErr", "");
            first_nameErr = true;
        }
    }

    // Validate Last Name value
    if(last_name == "" || last_name.length <= 0)
    {
        printError(""+currForm+"_"+"last_nameErr", "Please enter your last name");
        last_nameErr = false;
    }
    else
    {
        if(regex.test(last_name) === false)
        {
            printError(""+currForm+"_"+"last_nameErr", "Please enter a valid last name");
            last_nameErr = false;
        }
        else
        {
            printError(""+currForm+"_"+"last_nameErr", "");
            last_nameErr = true;
        }
    }

    // Validate City value
    if(city == "" || city.length <= 0)
    {
        printError(""+currForm+"_"+"cityErr", "Please enter your city");
        cityErr = false;
    }
    else
    {
        if(regex.test(city) === false)
        {
            printError(""+currForm+"_"+"cityErr", "Please enter a valid city");
            cityErr = false;
        }
        else
        {
            printError(""+currForm+"_"+"cityErr", "");
            cityErr = true;
        }
    }

    // Validate email address
    if(email == "" || email.length <= 0)
    {
        printError(""+currForm+"_"+"emailErr", "Please enter your email address");
        emailErr = false;
    }
    else
    {
        if(mail_regex.test(email) === false)
        {
            printError(""+currForm+"_"+"emailErr", "Please enter a valid email address");
            emailErr = false;
        }
        else
        {
            printError(""+currForm+"_"+"emailErr", "");
            emailErr = true;
        }
    }

    // Validate mobile number
    if(mobile == "" || mobile.length < 10)
    {
        printError(""+currForm+"_"+"mobileErr", "Please enter your mobile number");
        mobileErr = false;
    }
    else
    {
        if(mobile_regex.test(mobile) === false)
        {
            printError(""+currForm+"_"+"mobileErr", "Please enter a valid 10 digit mobile number");
            mobileErr = false;
        }
        else
        {
            printError(""+currForm+"_"+"mobileErr", "");
            mobileErr = true;
        }
    }

    // Prevent the form from being submitted if there are any errors
    if((first_nameErr && last_nameErr && emailErr && mobileErr && cityErr) === true)
    {
        var formData = {
        "firstName":first_name,
        "lastName":last_name,
        "city":city,
        "mobilePhone":mobile,
        "email":email,
        "leadFrom":"CAMPAIGN1"
    }
    
    $.ajax({
            type: "POST",
            url: domainBaseUrl + "/vo/simple-lead",
        	dataType: 'json',
			contentType: 'application/json',
			data:JSON.stringify(formData),
            success: function(res) {

				
        		if(res.statusCode==200){
        			document.getElementById(currForm+"_msg").innerHTML = "Thank you for submitting the details. We will get back to you soon.";
    			}else{
					document.getElementById(currForm+"_msg").innerHTML = "Error!! please try again later";
           		}
				
            },
            error:function (xhr, ajaxOptions, thrownError){
                	document.getElementById(currForm+"_msg").innerHTML = "Error!! please try again later";
            }
        })
    
        document.getElementById(currForm+"_msg").innerHTML = "Processing ...";
        return false;
    }
    else
    {
        // send form data to SalesForce.
        return false;
    }
}

function resetAllFields()
{
    // Reset all fields
    document.getElementById('spform').reset();
    document.getElementById('sfpopform').reset();
    var elems = document.querySelectorAll(".error");
    elems.forEach(itm => {
        document.getElementById(itm.id).innerHTML = ''
    })
    //--
    var elems = document.querySelectorAll(".thank-you-msg");
    elems.forEach(itm => {
        document.getElementById(itm.id).innerHTML = ''
    })
}

function resetCalc()
{
    // Reset all fields
    var elems = document.querySelectorAll(".rstfield");
    elems.forEach(itm => {
        //console.log(itm.id)
        document.getElementById(itm.id).value = ''
    })
    document.getElementById('btn_calc').disabled = false;
    winScrollEvt = true;
}
