function deleteSessionData(key){
	delete sessionStorage[key]
}
function setSessionData(key, value) {
	if (typeof (value) == "boolean") {
		value = JSON.stringify(value);
		sessionStorage.setItem(key, SterlEncrypto2017.encode(value));
		return;
	} else if (value == "" || value == undefined || value == "undefined") {
		sessionStorage.setItem(key, value);
		return;
	} else if (typeof (value) === 'object' || value == null) {
		sessionStorage.setItem(key, SterlEncrypto2017.encode(JSON.stringify(value)));
		return;
	} else {
		sessionStorage.setItem(key, SterlEncrypto2017.encode(value));
		return;
	}
}
function getSessionData(key) {
	var purevalue = sessionStorage.getItem(key);
	var temp;
	if (purevalue == "" || purevalue == undefined || purevalue == "undefined") {
		temp = sessionStorage.getItem(key);
	} else {
		temp = SterlEncrypto2017.decode(sessionStorage.getItem(key));
		if (temp == "true") {
			return true;
		} else if (temp == "false") {
			return false
		} else if (temp == "null") {
			return null;
		} else if (typeof (temp) === 'object') {
			return temp;
		} else if (typeof (temp) === 'string') {
			try {
				temp = JSON.parse(temp);
			} catch (e) {
				temp = SterlEncrypto2017.decode(sessionStorage.getItem(key));
			}
		}
	}
	return temp;
}
var SterlEncrypto2017 = {
    _keyStr: "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=",
    encode: function(e) {
        var t = "";
        var n, r, i, s, o, u, a;
        var f = 0;
        e = SterlEncrypto2017._utf8_encode(e);
        while (f < e.length) {
            n = e.charCodeAt(f++);
            r = e.charCodeAt(f++);
            i = e.charCodeAt(f++);
            s = n >> 2;
            o = (n & 3) << 4 | r >> 4;
            u = (r & 15) << 2 | i >> 6;
            a = i & 63;
            if (isNaN(r)) {
                u = a = 64;
            } else if (isNaN(i)) {
                a = 64;
            }
            t = t + this._keyStr.charAt(s) + this._keyStr.charAt(o) + this._keyStr.charAt(u) + this._keyStr.charAt(a)
        }
        return t
    },
    decode: function(e) {
        var t = "";
        var n, r, i;
        var s, o, u, a;
        var f = 0;
        e = e.replace(/[^A-Za-z0-9+/=]/g, "");
        while (f < e.length) {
            s = this._keyStr.indexOf(e.charAt(f++));
            o = this._keyStr.indexOf(e.charAt(f++));
            u = this._keyStr.indexOf(e.charAt(f++));
            a = this._keyStr.indexOf(e.charAt(f++));
            n = s << 2 | o >> 4;
            r = (o & 15) << 4 | u >> 2;
            i = (u & 3) << 6 | a;
            t = t + String.fromCharCode(n);
            if (u != 64) {
                t = t + String.fromCharCode(r)
            }
            if (a != 64) {
                t = t + String.fromCharCode(i)
            }
        }
        t = SterlEncrypto2017._utf8_decode(t);
        return t
    },
    _utf8_encode: function(e) {
        var t = "";
        for (var n = 0; n < e.length; n++) {
            var r = e.charCodeAt(n);
            if (r < 128) {
                t += String.fromCharCode(r)
            } else if (r > 127 && r < 2048) {
                t += String.fromCharCode(r >> 6 | 192);
                t += String.fromCharCode(r & 63 | 128)
            } else {
                t += String.fromCharCode(r >> 12 | 224);
                t += String.fromCharCode(r >> 6 & 63 | 128);
                t += String.fromCharCode(r & 63 | 128)
            }
        }
        return t
    },
    _utf8_decode: function(e) {
        var t = "";
        var n = 0;
        var r = c1 = c2 = 0;
        while (n < e.length) {
            r = e.charCodeAt(n);
            if (r < 128) {
                t += String.fromCharCode(r);
                n++
            } else if (r > 191 && r < 224) {
                c2 = e.charCodeAt(n + 1);
                t += String.fromCharCode((r & 31) << 6 | c2 & 63);
                n += 2
            } else {
                c2 = e.charCodeAt(n + 1);
                c3 = e.charCodeAt(n + 2);
                t += String.fromCharCode((r & 15) << 12 | (c2 & 63) << 6 | c3 & 63);
                n += 3
            }
        }
        return t
    }
};

function distance(lat1, lon1, lat2, lon2, unit) {
	var radlat1 = Math.PI * lat1 / 180
	var radlat2 = Math.PI * lat2 / 180
	var theta = lon1 - lon2
	var radtheta = Math.PI * theta / 180
	var dist = Math.sin(radlat1) * Math.sin(radlat2) + Math.cos(radlat1) * Math.cos(radlat2) * Math.cos(radtheta);
	dist = Math.acos(dist)
	dist = dist * 180 / Math.PI
	dist = dist * 60 * 1.1515
	if (unit == "K") {
		dist = dist * 1.609344
	}
	if (unit == "N") {
		dist = dist * 0.8684
	}
	return dist
}
function getOccupancyDetailsArr(roomOccupancy) {
    var occupancyDetailsArr = [],
        obj = {};
    if (!Array.isArray(roomOccupancy)) {
        obj = {};
		roomOccupancy = roomOccupancy;
        obj.roomId = roomOccupancy.roomID;
        obj.occupancyDetail = roomOccupancy.occupancyDetail;
        obj.maxOccupancyCount = roomOccupancy.maxOccupancyCount;
        obj.baseOccupancyCount = roomOccupancy.baseOccupancyCount;
        obj.extraOccupancyAdultCount = roomOccupancy.extraOccupancyAdultCount;
        obj.extraOccupancyChildCount = roomOccupancy.extraOccupancyChildCount;
        occupancyDetailsArr.push(obj);
    } else {
        for (var r = 0; r < roomOccupancy.length; r++) {
            obj = {};
            var roomOccupancyObj = JSON.parse(roomOccupancy[r]);
            obj.roomId = roomOccupancyObj.roomID;
            obj.occupancyDetail = roomOccupancyObj.occupancyDetail;
            obj.maxOccupancyCount = roomOccupancyObj.maxOccupancyCount;
            obj.baseOccupancyCount = roomOccupancyObj.baseOccupancyCount;
            obj.extraOccupancyAdultCount = roomOccupancyObj.extraOccupancyAdultCount;
            obj.extraOccupancyChildCount = roomOccupancyObj.extraOccupancyChildCount;
            occupancyDetailsArr.push(obj);
        }
    }
    return occupancyDetailsArr;
}
function getResortData(data,dropdownId){
	var jsonData = JSON.parse(data.responseText);
	////console.log(jsonData);
	RESORTDATA = [];
	var fileNames = [];
	Object.keys(jsonData).forEach(function(key) {
		if(key.toLowerCase().trim()!="jcr:content")
		{
			////console.log(key);
			if(jsonData[key]!=undefined && 
				jsonData[key]['jcr:content'] &&
					jsonData[key]['jcr:content']['par'] && 
						jsonData[key]['jcr:content']['par']['resort_overall'] && 
							jsonData[key]['jcr:content']['par']['resort_overall'] && 
								jsonData[key]['jcr:content']['par']['resort_overall']['data'] && 
									jsonData[key]['jcr:content']['par']['resort_overall']['data']['masterName']){
				RESORTDATA.push({
					'value':jsonData[key]['jcr:content']['par']['resort_overall']['data']['masterName'],
					'resortID':jsonData[key]['jcr:content']['par']['resort_overall']['data']['resortID'],
					'masterName':jsonData[key]['jcr:content']['par']['resort_overall']['data']['masterName'],
					'filename':key,
					'sfResortID':jsonData[key]['jcr:content']['par']['resort_overall']['data']['sfResortID'],
					'locationLatitude':jsonData[key]['jcr:content']['par']['resort_overall']['data']['locationLatitude'],
					'locationLongitude':jsonData[key]['jcr:content']['par']['resort_overall']['data']['locationLongitude'],
					'region':jsonData[key]['jcr:content']['par']['resort_overall']['data']['byregions'],
					'byregions':jsonData[key]['jcr:content']['par']['resort_overall']['data']['byregions'],
					'roomInfo':getOccupancyDetailsArr(jsonData[key]['jcr:content']['par']['resort_overall']['data']['roomInfo']),
					'resortAmenities':jsonData[key]['jcr:content']['par']['resort_overall']['data']['resortAmenitiesList'],
					'adress':jsonData[key]['jcr:content']['par']['resort_overall']['data']['address'],
					'petDisclaimerEnabled':jsonData[key]['jcr:content']['par']['resort_overall']['data']['petDisclaimerEnabled']?true:false
					});
				fileNames.push(key);
			}
		}
	});
	setSessionData('masterNameAndResortId',RESORTDATA);
	setSessionData('rsrtsFileName',fileNames);


		var destinationlocation = new Bloodhound({
			initialize: false,
			  datumTokenizer: Bloodhound.tokenizers.obj.whitespace('value','adress'),
			  queryTokenizer: Bloodhound.tokenizers.whitespace,
			  identify: function(obj) { return obj.value; },
			  local: RESORTDATA,
			  limit: RESORTDATA.length
			  //prefetch: '/etc/designs/sterling_site/js/data/destination.json'
		});
		var destinationlocationWithDefaults = function(q, sync) {
			if (q === '') {
			  sync(destinationlocation.all());// This is the only change needed to get 'ALL' items as the defaults
			}
			else {
			  destinationlocation.search(q, sync);
			}
		};
		destinationlocation.initialize();
	

		$('#'+dropdownId+'.typeahead').typeahead('destroy');

		
		$('#'+dropdownId+'.typeahead').typeahead({
		  minLength: 0,  
		  maxItem: RESORTDATA.length,
		  hint: false,
		  highlight: true,
		},
		{
		  name: 'states',
		  display: 'value',
		  offset: false,
		  source: destinationlocationWithDefaults,
		  limit: RESORTDATA.length,
		  templates: {
					  empty: [
							  '<div class="empty-message" id="empty-message">',
								  'No Destination Found',
							  '</div>'
							  ].join('\n'),
							  suggestion: Handlebars.compile('<div><div class="dest-resort"><strong>{{destination}}</strong> <span>{{value}}</span></div> <div class="type">{{type}}</div></div>')
					 }
		});

	
}
var DATA_CACHE = {};
function getData(url,callback){
    $.ajax({
    	url: url,
        cache: true,
        beforeSend: function () {
        	if(DATA_CACHE.hasOwnProperty(url)) {
        		if(DATA_CACHE[url]){
        			callback(DATA_CACHE[url]);
        			return false;
        		}
        	}
            return true;
        },
      complete: function (jqXHR, textStatus) {
    	  	if(textStatus=='success'){
    	  		DATA_CACHE[url] = jqXHR;
    		}
    	  	callback(jqXHR);
            //localCache.set(url, jqXHR, callback);
        }
    });
}
function postData(url,callback,data){
	if(data){
		$.ajax({
		type: "POST",
    	url: url,
		dataType: 'json',
		contentType: 'application/json',
		data:JSON.stringify(data),
        cache: false,
		success: function (data) {
            callback(data);
        }
		});
	}else{
		$.ajax({
			type: "POST",
			url: url,
			cache: false,
		  success: function (data) {
				callback(data);
			}
		});
	}
}

